tables.table_schema:
CREATE TABLE trading_signals (
  signal_id INT PRIMARY KEY,
  signal_time TIMESTAMP,
  signal_type VARCHAR(50),
  signal_score FLOAT
);

CREATE TABLE trading_actions (
  action_id INT PRIMARY KEY,
  action_time TIMESTAMP,
  action_type VARCHAR(50),
  action_price FLOAT
);

CREATE TABLE ml_algorithm_evaluation (
  evaluation_id INT PRIMARY KEY,
  algorithm_name VARCHAR(50),
  evaluation_time TIMESTAMP,
  evaluation_result FLOAT
);

CREATE TABLE machine_learning_models (
    model_id INT PRIMARY KEY,
    model_name VARCHAR(50),
    algorithm VARCHAR(50),
    training_data_source VARCHAR(100)
);

CREATE TABLE machine_learning_algorithm (
    id INT PRIMARY KEY,
    algorithm_name VARCHAR(100),
    description TEXT,
    accuracy FLOAT
);
